import React from 'react';

const Home = () => {
    return (
        <div>
            LOGIN PAGE!!!!!!!!!! Welcome to the app to pick the game! Login below, if there is someone I forgot, they can register.
            <p>Login</p><span>Register</span>
        </div>
    );
};

export default Home;
